function getNameRandVn($exclude = '', $type = 'female')
{
    $url = 'https://dichthuatphuongdong.com/tienich/do.php';

    $mm = [
        'action' => 'ten_tieng_viet_random',
        //    'gender'=>'male',
        'gender' => $type,
        'is_fullname' => 'yes',
        'surname_option' => 'select',
        'surname' => 'Lê',
        'so_luong' => 100,
        'exclude' => $exclude,
        'lang' => 'vi',
    ];

    $postdata = http_build_query(
        $mm
    );

    $opts = ['http' => [
        'method' => 'POST',
        'header' => 'Content-Type: application/x-www-form-urlencoded',
        'content' => $postdata,
    ],
    ];
    $context = stream_context_create($opts);
    $result = file_get_contents($url, false, $context);

    return $allName = explode('|', $result)[0];

}
